import React,{Component} from 'react'
import { Link,Switch ,Redirect,Route} from 'react-router-dom'
import HttpCallComponent from './httpsecurecomponent';

class Masterroute extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div>
                <switch>
                    <Route exact path='/' component='HttpCallComponent'></Route>
                    
                </switch>
            </div>
         );
    }
}
 
export default Masterroute;
